function SponsoredBills({ info }) {
    return (
        <div>
            { repSponsoredBills && (
                <table>
                    <tbody>
                        {repSponsoredBills.map((bill, index) => (
                            <tr key={`bill-${index}`}>
                                <td>{bill.introduce.Date}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}
        </div>
    );
}

export default SponsoredBills;
